function ListBoxes() {
  const setListBoxes = useState([]);

  const getBoxes = () => {
    Axios.get("http://localhost:3001/getboxes").then((response) => {
      let data = response.data;
      let list = [];
      console.log("hello");
      data.forEach((element) => {
        var c = element.weight * cost[element.country];
        let map = {
          id: element.id,
          receiver: element.name,
          weight: element.weight,
          color: "green",
          cost: c,
        };
        list.push(map);
      });
      setListBoxes(list);
      return list;
    });
  };
  return (
    <div>
            {setListBoxes.map((val, key) => {
              <div>
              <h3>Name: {val.name}</h3>
              <h3>weight: {val.weight}</h3>
              <h3>Color: {val.color}</h3>
              <h3>Id: {val.id}</h3>
            </div>
            })}
            </div>
  );
}
